function App() {
  return (
    <Router>
      <div className="App">
        <header className="App-header">
          {/* Common Header */}
          <Header />

          {/* Sidebar Navigation */}
          <Sidebar />

          {/* Navigation Links */}
          <nav className="nav-links">
            <ul>
              <li><Link to="/">Entity</Link></li>
              <li><Link to="/sentimentscore">Sentiment Score</Link></li>
              <li><Link to="/entityvisuals">Entity Visuals</Link></li>
              <li><Link to="/news">News</Link></li>
              <li><Link to="/newsbox">News Box</Link></li>
            </ul>
          </nav>

          {/* Define Routes */}
          <Routes>
            <Route path="/" element={<Entity />} />
            <Route path="/sentimentscore" element={<Sentimentscore />} />
            <Route path="/entityvisuals" element={<Entityvisuals />} />
            <Route path="/news" element={<News />} />
            <Route path="/newsbox" element={<NewsBox />} />
          </Routes>
        </header>
      </div>
    </Router>
  );
}
export default App;
